import React, { Component } from 'react'

class Counter extends Component {

    constructor(props) {
        super(props)

        this.state = {
            count: 0
        }
    }

    increment() {

        // this.state.count ++

        // this.setState({ count: this.state.count + 1 }, () => { console.log('callback', this.state.count) })
        // console.log(this.state.count)
        this.setState(() => this.incrementFive)
    }

    incrementFive(){
        this.increment()
        this.increment()

        this.increment()

        this.increment()

    }
    render() {
        return (
            <div>
                <div>Count - {this.state.count}</div>
                <button onClick={() => this.incrementFive()}>Click me</button>
            </div>
        )
    }
}

export default Counter
